// CardView.js
import React from "react";
import Card from "./Card";
import "./CardView.css";

function CardView(props) {
  const card = props.cards.filter((item) => item.id == 2);
  console.log(card);

  const newcard = Array.from({ length: card.count }, (_, i) => ({
    id: i + 1,
    volume: card.volume[i],
    Rupee: card.Rupee[i],
  }));

  console.log(newcard);

  return (
    <div className="card-view">
      {(Card) => (
        <Card key={card.id} volume={card.volume[1]} Rupee={card.Rupee} />
      )}
    </div>
  );
}

export default CardView;
